  true,\n\t\"url\": null,\n\t\"notes\": \"<p>Section 303 (d) of the Medicare Modernization
  Act (see Downloads section below) requires the implementation of a competitive acquisition
  program (CAP) for Medicare Part B drugs and biologicals not paid on a cost or prospective
  payment system basis. The CAP is an alternative to the ASP (buy and bill) methodology
  for acquiring certain Part B drugs which are administered incident to a physicians
  services.</p>n\",\n\t\"license_title\": \"Other License Specified\",\n\t\"extras\":
